script: |
  super -f text -I q4335.spq | sort > q4335.out

inputs:
  - name: q4335.spq
    data: |
      SELECT 79 - + col0 AS col1 FROM tab2 (FORMAT parquet) WHERE + 78 * ( - + col1 ) + col0 * + col2 NOT BETWEEN - - col1 * + col1 AND + col2;
  - name: tab2

outputs:
  - name: q4335.out
    data: |
      15
      33
      4
